const ChapterMap = () => {
   return (
      <section className="p-1 bg-lightest-grey rounded-3xl shadow-xl my-10 w-full max-w-5xl">
         {/* Container: US Map + Chapter Pins */}
         <div className="aspect-[5/3] h-auto relative w-full">
            <USMap />
            {chapters.map((item) => (
               <ChapterPin
                  key={item.location}
                  location={item.location}
                  lat={item.lat}
                  lon={item.lon}
                  zIndex={item.zIndex}
               />
            ))}
         </div>
      </section>
   )
}

